  { field: 'id', headerName: 'ID', flex: 0.5, headerAlign: 'center', align: 'center'},
  { field: 'cuenta_id', headerName: 'Cuenta', flex: 1, headerAlign: 'center', align: 'center' },
  { field: 'saldo', headerName: 'Saldo', flex: 1, headerAlign: 'center', align: 'center' },
  { field: 'estado', headerName: 'Estado', type: 'number' , flex: 1, headerAlign: 'center', align: 'center' },
  {field: 'fecha', headerName: 'Fecha de creación', flex: 1, headerAlign: 'center', align: 'center' }
];
